E_D("replace into `phome_ecms_news_data_1` values('1887','51','','1','0','0','0','','','','<p><span style=\\\\\"font-family: 宋体; font-size: 10.5pt; mso-spacerun: \\\\''yes\\\\''; mso-font-kerning: 1.0000pt\\\\\"><span style=\\\\\"font-family: 宋体; font-size: 10.5pt; mso-spacerun: \\\\''yes\\\\''; mso-font-kerning: 1.0000pt\\\\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>瓷砖是把粘土、石英砂等等原材料经研磨、混合、压制、施釉、烧结而成的耐火的金属氧化物及半金属氧化物。瓷砖的实质是耐酸碱的瓷质或石质，被广泛应用于建筑和装修。瓷砖日益成为广大</span><span style=\\\\\"font-size: 14px\\\\\"><span style=\\\\\"font-family: 宋体; text-decoration: underline\\\\\" class=\\\\\"15\\\\\">家庭装修</span></span><span style=\\\\\"font-family: 宋体; font-size: 10.5pt; mso-spacerun: \\\\''yes\\\\''; mso-font-kerning: 1.0000pt\\\\\">时的必需品。瓷砖的品质影响到每家每户的生活品质，鉴于此，国家数次修改对瓷砖分类检验标准，以求保证国民生活质量。</span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><span style=\\\\\"font-family: 宋体; font-size: 10.5pt; mso-spacerun: \\\\''yes\\\\''; mso-font-kerning: 1.0000pt\\\\\"><span style=\\\\\"font-family: 宋体; font-size: 10.5pt; mso-spacerun: \\\\''yes\\\\''; mso-font-kerning: 1.0000pt\\\\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>国家在今年依然延续对瓷砖生产的严厉监控，下面哈德逊小编原创</span><span style=\\\\\"font-family: 宋体; font-size: 10.5pt; mso-spacerun: \\\\''yes\\\\''; mso-font-kerning: 1.0000pt\\\\\">图解<font face=\\\\\"Times New Roman\\\\\">2015</font><font face=\\\\\"宋体\\\\\">最新</font></span><span style=\\\\\"font-family: 宋体; font-size: 10.5pt; mso-spacerun: \\\\''yes\\\\''; mso-font-kerning: 1.0000pt\\\\\">国家瓷砖分类检验标准。</span><span style=\\\\\"font-family: 宋体; font-size: 10.5pt; mso-spacerun: \\\\''yes\\\\''; mso-font-kerning: 1.0000pt\\\\\"><br />\r\n</span></p>\r\n<p style=\\\\\"text-align: left\\\\\" class=\\\\\"MsoNormal\\\\\">&nbsp;</p>\r\n<p style=\\\\\"text-align: center\\\\\" class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-family: 宋体; font-size: 10.5pt; mso-spacerun: \\\\''yes\\\\''; mso-font-kerning: 1.0000pt\\\\\">&nbsp;<img width=\\\\\"550\\\\\" height=\\\\\"750\\\\\" src=\\\\\"/d/file/xwzx/qyxw/2015-03-25/f97fedd3e93f75b40b57398603cfc8e3.jpg\\\\\" alt=\\\\\"图解2015国家瓷砖分类检验标准.jpg\\\\\" /></span></p>\r\n<p style=\\\\\"text-align: center\\\\\" class=\\\\\"MsoNormal\\\\\">&nbsp;</p>\r\n<p style=\\\\\"text-align: left\\\\\" class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-family: 宋体; font-size: 10.5pt; mso-spacerun: \\\\''yes\\\\''; mso-font-kerning: 1.0000pt\\\\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 广</span><u><span style=\\\\\"font-family: 宋体; font-size: 10.5pt; mso-spacerun: \\\\''yes\\\\''; mso-font-kerning: 1.0000pt\\\\\">东</span></u><span style=\\\\\"font-size: 14px\\\\\"><span style=\\\\\"font-family: 宋体; text-decoration: underline\\\\\" class=\\\\\"15\\\\\">哈德逊瓷砖</span></span><span style=\\\\\"font-family: 宋体; font-size: 10.5pt\\\\\">严格遵守国家瓷砖分类检验标准，严于律己，生产的瓷砖产品均在国家标准之上，力求为广大消费者提供远超国家瓷砖分类检验标准的瓷砖优等品。除此之外，哈德逊瓷砖</span><span style=\\\\\"font-family: 宋体; font-size: 10.5pt; mso-spacerun: \\\\''yes\\\\''; mso-font-kerning: 1.0000pt\\\\\">到传承国外大品牌对瓷砖的分类检验标准，产品质量上乘。如此高质产品，除了在国内热销，还远销海外，深受海内外消费者厚爱。</span></p>\r\n<p style=\\\\\"text-align: left\\\\\" class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-family: 宋体; font-size: 10.5pt; mso-spacerun: \\\\''yes\\\\''; mso-font-kerning: 1.0000pt\\\\\">&nbsp;</span></p>\r\n<p style=\\\\\"text-align: left\\\\\" class=\\\\\"MsoNormal\\\\\">&nbsp;</p>\r\n<p style=\\\\\"text-align: left; text-indent: 21pt; margin-left: 0pt; mso-pagination: widow-orphan\\\\\" class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"text-transform: none; font-style: normal; font-family: 宋体; letter-spacing: 0pt; font-size: 10.5pt; font-weight: normal; mso-spacerun: \\\\''yes\\\\''; mso-font-kerning: 0.0000pt\\\\\">文章来源：哈德逊瓷砖编辑原创</span></p>\r\n<p style=\\\\\"text-align: left; text-indent: 21pt; margin-left: 0pt; mso-pagination: widow-orphan\\\\\" class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"text-transform: none; font-style: normal; font-family: 宋体; letter-spacing: 0pt; font-size: 10.5pt; font-weight: normal; mso-spacerun: \\\\''yes\\\\''; mso-font-kerning: 0.0000pt\\\\\">转载请注明出处</span><span style=\\\\\"text-transform: none; font-style: normal; font-family: 宋体; letter-spacing: 0pt; font-size: 10.5pt; font-weight: normal; text-decoration: underline\\\\\">http://www.hudsonhome.cn</span><span style=\\\\\"text-transform: none; font-style: normal; font-family: 宋体; letter-spacing: 0pt; font-size: 9pt; font-weight: normal; text-decoration: underline\\\\\">&ensp;</span></p>\r\n<p>&nbsp;</p>');");
E_D("replace into `phome_ecms_news_data_1` values('1888','8','','1','0','0','0','','','','<p>&nbsp;<span style=\\\\\"font-size: 14px\\\\\"><span style=\\\\\"color: rgb(0,0,255); text-decoration: underline; text-underline: single\\\\\"><a href=\\\\\"http://www.hudsonhome.cn/xwzx/qyxw/2014-11-05/1200.html\\\\\"><span style=\\\\\"color: #0000ff\\\\\">瓷砖买什么牌子好</span></a></span></span><span style=\\\\\"font-size: 10.5pt\\\\\">？市面上瓷砖种类多不胜数，瓷砖品牌让人眼花缭乱。人们在进行家装选购瓷砖时通常会为买什么牌子的瓷砖而发愁。部分消费者也许会有先见之明，购买前会上网搜索一下哪个牌子的瓷砖质量好，但是网上的信息铺天盖地，也不知道从何下手。</span></p>\r\n<div style=\\\\\"text-indent: 21pt\\\\\">&nbsp;</div>\r\n<div style=\\\\\"text-indent: 21pt\\\\\"><span style=\\\\\"font-size: 10.5pt\\\\\">在品牌化日趋明显的现代社会，消费者追求品牌瓷砖无可厚非。但是在面对林林总总的瓷砖牌子，消费者要理性对待，买瓷砖前要多了解，货比三家，做一个精明的消费者。知名度较高的瓷砖品牌，他们的质量值得信赖，有完善的服务流程。在进行选购时，可以优先考虑大牌子的瓷砖，万一质量出现问题，大牌子的售后服务比较有保障。如今国内瓷砖十大品牌，</span><span style=\\\\\"font-size: 14px\\\\\"><span style=\\\\\"color: rgb(0,0,255); text-decoration: underline; text-underline: single\\\\\"><a href=\\\\\"http://www.hudsonhome.cn/xwzx/qyxw/2014-09-10/485.html\\\\\"><span style=\\\\\"color: #0000ff\\\\\">瓷砖一线品牌</span></a></span></span><span style=\\\\\"font-size: 10.5pt\\\\\">等等的排行榜不绝于耳，消费者选择时可以作为参考。</span></div>\r\n<div style=\\\\\"text-indent: 21pt\\\\\">&nbsp;</div>\r\n<div style=\\\\\"text-align: center; text-indent: 21pt\\\\\"><span style=\\\\\"font-size: 10.5pt\\\\\"><img alt=\\\\\"瓷砖买什么牌子好.jpg\\\\\" width=\\\\\"550\\\\\" height=\\\\\"454\\\\\" src=\\\\\"/d/file/xwzx/qyxw/2015-03-25/1f5fad3bce281d3bc2afea932ef32927.jpg\\\\\" /></span></div>\r\n<div style=\\\\\"text-indent: 21pt\\\\\">&nbsp;</div>\r\n<div style=\\\\\"text-indent: 21pt\\\\\"><span style=\\\\\"font-size: 10.5pt\\\\\">瓷砖买什么牌子好，哈德逊怎么样？哈德逊瓷砖以为消费者提供最透明、贴心的服务为出发点，拥有多年的电商运营经验，开创了网购瓷砖的先河。通过线上线下相结合的新型电商O2O模式，消费者可以在</span><span style=\\\\\"font-size: 14px\\\\\"><span style=\\\\\"color: rgb(0,0,255); text-decoration: underline; text-underline: single\\\\\"><a href=\\\\\"http://www.hudsonhome.cn\\\\\"><span style=\\\\\"color: #0000ff\\\\\">哈德逊瓷砖</span></a></span></span><span style=\\\\\"font-size: 10.5pt\\\\\">天猫商城、京东商城等各种线上渠道选购家居瓷砖，针对家居的不同空间客厅、餐厅、卧室、厨房、卫生间、玄关、背景墙，可以任意选择各种风格的抛光砖，全抛釉，微晶石，仿古砖，木纹砖等不同瓷砖产品，并可任意组合搭配，自主设计家里的装修风格，足不出户，即可一站式获得想要装修风格，并可在线购买产品。打造美轮美奂家装随心所欲，快捷简单。</span></div>\r\n<div style=\\\\\"text-indent: 21pt\\\\\">&nbsp;</div>\r\n<div style=\\\\\"text-indent: 21pt\\\\\"><span style=\\\\\"font-size: 10.5pt\\\\\">在瓷砖品牌林立的今天，选对瓷砖牌子等于装修成功了一半。因此在选购时切忌操之过急，除了看品牌，还要注重质量。哈德逊瓷砖作为网购瓷砖领导品牌，值得信赖。瓷砖买什么牌子好，首选哈德逊瓷砖。</span></div>\r\n<div style=\\\\\"text-indent: 21pt\\\\\">&nbsp;</div>\r\n<div style=\\\\\"text-indent: 21pt\\\\\">&nbsp;</div>\r\n<div style=\\\\\"text-indent: 21pt\\\\\"><span style=\\\\\"text-transform: none; font-style: normal; letter-spacing: 0pt; font-size: 10.5pt; font-weight: normal\\\\\">文章来源：哈德逊瓷砖编辑原创</span></div>\r\n<div style=\\\\\"text-indent: 21pt\\\\\"><span style=\\\\\"text-transform: none; font-style: normal; letter-spacing: 0pt; font-size: 10.5pt; font-weight: normal\\\\\">转载请注明出处</span><a href=\\\\\"http://www.hudsonhome.cn/\\\\\"><span style=\\\\\"text-transform: none; font-style: normal; letter-spacing: 0pt; color: rgb(0,0,255); font-size: 10.5pt; font-weight: normal\\\\\">http://www.hudsonhome.cn<span style=\\\\\"text-transform: none; font-style: normal; letter-spacing: 0pt; color: rgb(102,102,102); font-size: 9pt; font-weight: normal\\\\\">&ensp;</span></span></a></div>');");
E_D("replace into `phome_ecms_news_data_1` values('1889','8','1895','1','0','0','0','','','','<p style=\\\\\"text-align: left;\\\\\"><span style=\\\\\"font-size: 14px;\\\\\">每个人都或多或少好奇过&mdash;&mdash;瓷砖是怎么做的？那些或亮晶晶bling bling、或散发着迷人哑光、或图案繁复华丽、或天然去雕饰般<a href=\\\\\"http://www.hudsonhome.cn/xwzx/qyxw/2014-09-09/480.html\\\\\"><u><span style=\\\\\"color: rgb(0, 0, 255);\\\\\">简约的瓷砖</span></u></a>，静静的躺在那里，引人无限遐想。那么，瓷砖是怎样炼成的呢？哈德逊小编为您解惑：</span></p>\r\n<p style=\\\\\"text-align: center;\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><br />\r\n<br />\r\n<img width=\\\\\"550\\\\\" height=\\\\\"750\\\\\" alt=\\\\\"瓷砖是怎样炼成的,瓷砖是怎么做的.jpg\\\\\" src=\\\\\"/d/file/xwzx/qyxw/2015-03-25/6efa34ff0b9a1fcc7b37cc854e9a004f.jpg\\\\\" /></span></p>\r\n<p style=\\\\\"text-align: left;\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp; 如此炼出的如钢铁般强硬的瓷砖，每一片都是先进技术与高度耐心的结合。那么，哈德逊瓷砖是怎样炼成的呢？哈德逊瓷砖严格遵守<a href=\\\\\"http://www.hudsonhome.cn/xwzx/qyxw/2015-03-25/1886.html\\\\\"><u><span style=\\\\\"color: rgb(0, 0, 255);\\\\\">陶瓷砖国家标准</span></u></a>，传承着国外大品牌对瓷砖的严格生产标准。完美、原创、精致与虔诚是哈德逊一直以来的服务标准。让客户更好地感受哈德逊的品牌、信誉、质量就是我们给消费者最好的保障。<br />\r\n</span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><!--[if gte mso 9]><xml><w:WordDocument><w:BrowserLevel>MicrosoftInternetExplorer4</w:BrowserLevel><w:DisplayHorizontalDrawingGridEvery>0</w:DisplayHorizontalDrawingGridEvery><w:DisplayVerticalDrawingGridEvery>2</w:DisplayVerticalDrawingGridEvery><w:DocumentKind>DocumentNotSpecified</w:DocumentKind><w:DrawingGridVerticalSpacing>7.8 磅</w:DrawingGridVerticalSpacing><w:PunctuationKerning></w:PunctuationKerning><w:View>Normal</w:View><w:Compatibility><w:DontGrowAutofit /><w:BalanceSingleByteDoubleByteWidth /><w:DoNotExpandShiftReturn /><w:UseFELayout /></w:Compatibility><w:Zoom>0</w:Zoom></w:WordDocument></xml><![endif]--></p>\r\n<p><!--[if gte mso 9]><xml><w:LatentStyles DefLockedState=\\\\\"false\\\\\"  DefUnhideWhenUsed=\\\\\"true\\\\\"  DefSemiHidden=\\\\\"true\\\\\"  DefQFormat=\\\\\"fa