-font-family:\\\\''Times New Roman\\\\''; mso-hansi-font-family:\\\\''Times New Roman\\\\''; mso-bidi-font-family:\\\\''Times New Roman\\\\''; font-size:10.5000pt; mso-font-kerning:1.0000pt; \\\\\">一首《<font face=\\\\\"Times New Roman\\\\\">country&nbsp;road</font><font face=\\\\\"宋体\\\\\">》</font></span><span style=\\\\\"mso-spacerun:\\\\''yes\\\\''; font-family:宋体; mso-ascii-font-family:\\\\''Times New Roman\\\\''; mso-hansi-font-family:\\\\''Times New Roman\\\\''; mso-bidi-font-family:\\\\''Times New Roman\\\\''; font-size:10.5000pt; mso-font-kerning:1.0000pt; \\\\\">轻易的吹起了一股乡村风。音乐一奏起，就引人不由自主的遥想那一条乡村路，那个遗落着小时候欢声笑语的地方。美式乡村风可谓是一种复古风，是一种回归自然的选择。近年来美式乡村风格装修大热，除了其美观因素在内，更是符合了现代人返璞归真、亲近自然的居住理念。</span></p>\r\n<p style=\\\\\"mso-pagination:widow-orphan; \\\\\" class=\\\\\"pre\\\\\"><span style=\\\\\"mso-spacerun:\\\\''yes\\\\''; font-family:宋体; mso-ascii-font-family:\\\\''Times New Roman\\\\''; mso-hansi-font-family:\\\\''Times New Roman\\\\''; mso-bidi-font-family:\\\\''Times New Roman\\\\''; font-size:10.5000pt; mso-font-kerning:1.0000pt; \\\\\">&nbsp;</span></p>\r\n<p style=\\\\\"mso-pagination:widow-orphan; \\\\\" class=\\\\\"pre\\\\\"><span style=\\\\\"mso-spacerun:\\\\''yes\\\\''; font-family:宋体; mso-ascii-font-family:\\\\''Times New Roman\\\\''; mso-hansi-font-family:\\\\''Times New Roman\\\\''; mso-bidi-font-family:\\\\''Times New Roman\\\\''; font-size:10.5000pt; mso-font-kerning:1.0000pt; \\\\\">&nbsp;美式乡村风格有务实、规范、成熟的特点，带着浓浓的乡村气息，以享受为最高原则。乡村风格的色彩多以自然色调为主，绿色、土褐色较为常见，特别是墙面色彩选择上，自然、怀旧、散发着质朴气息的色彩成为首选。以往在打造美式乡村风格时，</span><span style=\\\\\"font-size: 14px;\\\\\"><a href=\\\\\"http://www.hudsonhome.cn/xwzx/qyxw/2014-12-12/1513.html\\\\\"><span style=\\\\\"font-family: 宋体; color: rgb(0, 0, 255); text-decoration: underline;\\\\\" class=\\\\\"15\\\\\">客厅地砖选什么</span></a></span><span style=\\\\\"mso-spacerun:\\\\''yes\\\\''; font-family:宋体; mso-ascii-font-family:\\\\''Times New Roman\\\\''; mso-hansi-font-family:\\\\''Times New Roman\\\\''; mso-bidi-font-family:\\\\''Times New Roman\\\\''; font-size:10.5000pt; mso-font-kerning:1.0000pt; \\\\\">？通常选用樱桃木或枫木。而随着现代仿木纹砖的出现，其惟妙惟肖的砖面高度仿真了木地板纹理，而且具有易打理，清洁简单，寿命更长的特点，很多家庭在打造美式乡村风格的时候，客厅地砖都偏向于选择仿木纹瓷砖。</span></p>\r\n<p style=\\\\\"mso-pagination:widow-orphan; \\\\\" class=\\\\\"pre\\\\\">&nbsp;</p>\r\n<p style=\\\\\"text-align: center;\\\\\" class=\\\\\"pre\\\\\"><span style=\\\\\"mso-spacerun:\\\\''yes\\\\''; font-family:宋体; mso-ascii-font-family:\\\\''Times New Roman\\\\''; mso-hansi-font-family:\\\\''Times New Roman\\\\''; mso-bidi-font-family:\\\\''Times New Roman\\\\''; font-size:10.5000pt; mso-font-kerning:1.0000pt; \\\\\">&nbsp;<img width=\\\\\"550\\\\\" height=\\\\\"329\\\\\" src=\\\\\"/d/file/xwzx/qyxw/2015-03-25/69b4210848a2680dc71a901c7f6a3101.jpg\\\\\" alt=\\\\\"美式乡村风格用什么地砖.jpg\\\\\" /></span></p>\r\n<p style=\\\\\"mso-pagination:widow-orphan; \\\\\" class=\\\\\"pre\\\\\">&nbsp;</p>\r\n<p style=\\\\\"mso-pagination:widow-orphan; \\\\\" class=\\\\\"pre\\\\\"><span><a href=\\\\\"http://www.hudsonhome.cn/xwzx/qyxw/2014-10-18/1005.html\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体; color: rgb(0, 0, 255); text-decoration: underline;\\\\\" class=\\\\\"15\\\\\">哪个仿木纹瓷砖品牌好</span></span></a></span><span style=\\\\\"mso-spacerun:\\\\''yes\\\\''; font-family:宋体; mso-ascii-font-family:\\\\''Times New Roman\\\\''; mso-hansi-font-family:\\\\''Times New Roman\\\\''; mso-bidi-font-family:\\\\''Times New Roman\\\\''; font-size:10.5000pt; mso-font-kerning:1.0000pt; \\\\\">？哈德逊的这款仿木纹瓷砖（型号：<font face=\\\\\"Times New Roman\\\\\">HDMW09</font><font face=\\\\\"宋体\\\\\">），高仿真度的模仿了非洲梨木，专为美式乡村风格设计，有原木色、浅黄色、棕黄色、棕灰色、深棕色</font><font face=\\\\\"Times New Roman\\\\\">5</font><font face=\\\\\"宋体\\\\\">色可选，最大程度的满足个性化。图中展示的是深棕色，在打造美式乡村风格上是一个很好的选择。</font></span></p>\r\n<p style=\\\\\"mso-pagination:widow-orphan; \\\\\" class=\\\\\"pre\\\\\"><span style=\\\\\"mso-spacerun:\\\\''yes\\\\''; font-family:宋体; mso-ascii-font-family:\\\\''Times New Roman\\\\''; mso-hansi-font-family:\\\\''Times New Roman\\\\''; mso-bidi-font-family:\\\\''Times New Roman\\\\''; font-size:10.5000pt; mso-font-kerning:1.0000pt; \\\\\">&nbsp;</span></p>\r\n<p style=\\\\\"mso-pagination:widow-orphan; \\\\\" class=\\\\\"pre\\\\\"><span style=\\\\\"mso-spacerun:\\\\''yes\\\\''; font-family:宋体; mso-ascii-font-family:\\\\''Times New Roman\\\\''; mso-hansi-font-family:\\\\''Times New Roman\\\\''; mso-bidi-font-family:\\\\''Times New Roman\\\\''; font-size:10.5000pt; mso-font-kerning:1.0000pt; \\\\\">在打造美式乡村风格时，选用客厅地砖最好选择无危害、低辐射、甲醛含量越低越好的地砖。除了在美感度上把关，在健康环保上也是要做好功课。哈德逊瓷砖为了让消费者放心购买，严格把关原材料，<font face=\\\\\"Times New Roman\\\\\">1250</font><font face=\\\\\"宋体\\\\\">度的高温煅烧，彻底解决有害物质等环保问题，确保产品没有污染危害。无危害，更环保。</font></span></p>\r\n<p style=\\\\\"mso-pagination:widow-orphan; \\\\\" class=\\\\\"pre\\\\\"><span style=\\\\\"mso-spacerun:\\\\''yes\\\\''; font-family:宋体; mso-ascii-font-family:\\\\''Times New Roman\\\\''; mso-hansi-font-family:\\\\''Times New Roman\\\\''; mso-bidi-font-family:\\\\''Times New Roman\\\\''; font-size:10.5000pt; mso-font-kerning:1.0000pt; \\\\\">&nbsp;</span></p>\r\n<p style=\\\\\"mso-pagination:widow-orphan; \\\\\" class=\\\\\"pre\\\\\">&nbsp;</p>\r\n<p style=\\\\\"margin-left:0.0000pt; text-indent:21.0000pt; mso-pagination:widow-orphan; text-align:left; \\\\\" class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"mso-spacerun:\\\\''yes\\\\''; font-family:宋体; letter-spacing:0.0000pt; font-weight:normal; text-transform:none; font-style:normal; font-size:10.5000pt; mso-font-kerning:0.0000pt; \\\\\">文章来源：哈德逊瓷砖编辑原创</span></p>\r\n<p style=\\\\\"margin-left:0.0000pt; text-indent:21.0000pt; mso-pagination:widow-orphan; text-align:left; \\\\\" class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"mso-spacerun:\\\\''yes\\\\''; font-family:宋体; letter-spacing:0.0000pt; font-weight:normal; text-transform:none; font-style:normal; font-size:10.5000pt; mso-font-kerning:0.0000pt; \\\\\">转载请注明出处</span><a href=\\\\\"http://www.hudsonhome.cn\\\\\"><span style=\\\\\"mso-spacerun:\\\\''yes\\\\''; font-family:宋体; color:rgb(0,0,255); letter-spacing:0.0000pt; font-weight:normal; text-transform:none; text-decoration:underline; text-underline:single; font-style:normal; font-size:10.5000pt; mso-font-kerning:0.0000pt; \\\\\">http://www.hudsonhome.cn</span><span style=\\\\\"mso-spacerun:\\\\''yes\\\\''; font-family:宋体; color:rgb(0,0,255); letter-spacing:0.0000pt; font-weight:normal; text-transform:none; text-decoration:underline; text-underline:single; font-style:normal; font-size:9.0000pt; mso-font-kerning:0.0000pt; \\\\\">&ensp;</span></a></p>\r\n<p>&nbsp;</p>');");
E_D("replace into `phome_ecms_news_data_1` values('1895','51','1889','1','0','0','0','','','','<p style=\\\\\"text-align: left;\\\\\"><span style=\\\\\"font-size: 14px;\\\\\">&nbsp;&nbsp;&nbsp; 每个人都或多或少好奇过&mdash;&mdash;瓷砖是怎么做的？那些或亮晶晶bling bling、或散发着迷人哑光、或图案繁复华丽、或天然去雕饰般<u>简约的瓷砖</u>，静静的躺在那里，引人无限遐想。那么，瓷砖是怎样炼成的呢？哈德逊小编为您解惑：</span></p>\r\n<p style=\\\\\"text-align: center;\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><br />\r\n<br />\r\n<img width=\\\\\"550\\\\\" height=\\\\\"750\\\\\" alt=\\\\\"瓷砖是怎样炼成的,瓷砖是怎么做的.jpg\\\\\" src=\\\\\"/d/file/xwzx/qyxw/2015-03-25/6efa34ff0b9a1fcc7b37cc854e9a004f.jpg\\\\\" /></span></p>\r\n<p style=\\\\\"text-align: left;\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><br />\r\n&nbsp;&nbsp;&nbsp;&nbsp; 如此炼出的如钢铁般强硬的瓷砖，每一片都是先进技术与高度耐心的结合。那么，哈德逊瓷砖是怎样炼成的呢？哈德逊瓷砖严格遵守<u>国家瓷砖分类检验标准</u>，传承着国外大品牌对瓷砖的严格生产标准。完美、原创、精致与虔诚是哈德逊一直以来的服务标准。让客户更好地感受哈德逊的品牌、信誉、质量就是我们给消费者最好的保障。<br />\r\n</span></p>\r\n<p>&nbsp;</p>\r\n<p><!--[if gte mso 9]><xml><w:WordDocument><w:BrowserLevel>MicrosoftInternetExplorer4</w:BrowserLevel><w:DisplayHorizontalDrawingGridEvery>0</w:DisplayHorizontalDrawingGridEvery><w:DisplayVerticalDrawingGridEvery>2</w:DisplayVerticalDrawingGridEvery><w:DocumentKind>DocumentNotSpecified</w:DocumentKind><w:DrawingGridVerticalSpacing>7.8 磅</w:DrawingGridVerticalSpacing><w:PunctuationKerning></w:PunctuationKerning><w:View>Normal</w:View><w:Compatibility><w:DontGrowAutofit /><w:BalanceSingleByteDoubleByteWidth /><w:DoNotExpandShiftReturn /><w:UseFELayout /></w:Compatibility><w:Zoom>0</w:Zoom></w:WordDocument></xml><![endif]--></p>\r\n<p><!--[if gte mso 9]><xml><w:LatentStyles DefLockedState=\\\\\"false\\\\\"  DefUnhideWhenUsed=\\\\\"true\\\\\"  DefSemiHidden=\\\\\"true\\\\\"  DefQFormat=\\\\\"false\\\\\"  DefPriority=\\\\\"99\\\\\"  LatentStyleCount=\\\\\"260\\\\\" >\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Normal\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Pri