\\\"  Name=\\\\\"Medium Grid 2 Accent 6\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Medium Grid 3 Accent 6\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Dark List Accent 6\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Colorful Shading Accent 6\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Colorful List Accent 6\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Colorful Grid Accent 6\\\\\" ></w:LsdException>\r\n</w:LatentStyles></xml><![endif]--><span style=\\\\\"mso-spacerun:\\\\''yes\\\\''; font-family:宋体; font-size:10.5000pt; mso-font-kerning:1.0000pt; \\\\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 杜甫很忙，可还是抽空作了首诗，名曰《可叹诗》，其中有一句&ldquo;天上浮云似白衣，斯须改变如苍狗。&rdquo;&nbsp;取每句的后两字，组成&ldquo;白云苍狗&rdquo;，比喻世事变幻不定，人生难以揣测。能如此把天上白云和地上苍狗联系起来，而且能赋予如此深刻意义，足以看出杜甫脑洞之大，以及后人强大的脑补能力。那么，问题来了，佛山瓷砖哪家强？</span></p>\r\n<p class=\\\\\"MsoNormal\\\\\" style=\\\\\"text-align:justify; text-justify:inter-ideograph; \\\\\"><span style=\\\\\"mso-spacerun:\\\\''yes\\\\''; font-family:宋体; font-size:10.5000pt; mso-font-kerning:1.0000pt; \\\\\">&nbsp;</span></p>\r\n<p class=\\\\\"MsoNormal\\\\\" style=\\\\\"text-align:justify; text-justify:inter-ideograph; \\\\\"><span style=\\\\\"mso-spacerun:\\\\''yes\\\\''; font-family:宋体; font-size:10.5000pt; mso-font-kerning:1.0000pt; \\\\\"><span style=\\\\\"mso-spacerun:\\\\''yes\\\\''; font-family:宋体; font-size:10.5000pt; mso-font-kerning:1.0000pt; \\\\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>佛山顺德有一句话：一方水土，养一方人。这句话同样适用于瓷砖，佛山的地理环境，使得其出产的陶土密度高、颜色洁白，尤其适合用于瓷砖的制作。因此，佛山的陶瓷工艺具有悠久历史，尤其是石湾一带，附近都是制作陶瓷的集散地，具有良好的工艺技术传承，所以不但瓷砖，卫浴瓷具等很多产品都是出自佛山。</span><span style=\\\\\"font-size: 14px;\\\\\"><span class=\\\\\"15\\\\\" style=\\\\\"font-family: 宋体; text-decoration: underline;\\\\\">全国瓷砖十大品牌</span></span><span style=\\\\\"font-family: 宋体; font-size: 10.5pt;\\\\\">也是出自佛山。</span></p>\r\n<p class=\\\\\"MsoNormal\\\\\" style=\\\\\"text-align:justify; text-justify:inter-ideograph; \\\\\">&nbsp;</p>\r\n<p class=\\\\\"MsoNormal\\\\\" style=\\\\\"text-align: center;\\\\\"><span style=\\\\\"mso-spacerun:\\\\''yes\\\\''; font-family:宋体; font-size:10.5000pt; mso-font-kerning:1.0000pt; \\\\\">&nbsp;<img width=\\\\\"550\\\\\" height=\\\\\"360\\\\\" align=\\\\\"middle\\\\\" alt=\\\\\"佛山瓷砖哪家强,佛山瓷砖十大品牌.jpg\\\\\" src=\\\\\"/d/file/xwzx/qyxw/2015-03-25/3b26a1c3440314c3ab858a9b8fec43d1.jpg\\\\\" /></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\" style=\\\\\"text-align:justify; text-justify:inter-ideograph; \\\\\">&nbsp;</p>\r\n<p class=\\\\\"MsoNormal\\\\\" style=\\\\\"text-align:justify; text-justify:inter-ideograph; \\\\\"><span style=\\\\\"mso-spacerun:\\\\''yes\\\\''; font-family:宋体; font-size:10.5000pt; mso-font-kerning:1.0000pt; \\\\\"><span style=\\\\\"mso-spacerun:\\\\''yes\\\\''; font-family:宋体; font-size:10.5000pt; mso-font-kerning:1.0000pt; \\\\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>要回答佛山瓷砖哪家强？这个问题，小编必须诚实的说，佛山瓷砖品牌排名在前十的实力都是很强的，有驰名的东鹏，有取了个外国人名字的马可波罗、蒙娜丽莎等等，更有和一条上演过奇迹的在美国独立战争中具有重要战略地位的知名河流同名的&mdash;&mdash;哈德逊瓷砖。哈德逊瓷砖作为后起之秀，在短短十年内做到今天的销量达到亿量级别的规模，产品畅销海内外，靠的是哈德逊瓷砖优越的产品质量，以及哈德逊人谦逊诚信努力的品质。</span></p>\r\n<p class=\\\\\"MsoNormal\\\\\" style=\\\\\"text-align:justify; text-justify:inter-ideograph; \\\\\">&nbsp;</p>\r\n<p class=\\\\\"MsoNormal\\\\\" style=\\\\\"text-align:justify; text-justify:inter-ideograph; \\\\\"><span style=\\\\\"mso-spacerun:\\\\''yes\\\\''; font-family:宋体; font-size:10.5000pt; mso-font-kerning:1.0000pt; \\\\\"><span style=\\\\\"mso-spacerun:\\\\''yes\\\\''; font-family:宋体; font-size:10.5000pt; mso-font-kerning:1.0000pt; \\\\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>除了在传统渠道的强大实力外，哈德逊还开创了</span><span style=\\\\\"font-size: 14px;\\\\\"><span class=\\\\\"15\\\\\" style=\\\\\"font-family: 宋体; text-decoration: underline;\\\\\">陶瓷电商</span></span><span style=\\\\\"font-family: 宋体; font-size: 10.5pt;\\\\\">先河，成为国内建陶行业电商&rdquo;鼻祖&rdquo;。获有</span><span style=\\\\\"mso-spacerun:\\\\''yes\\\\''; font-family:宋体; font-size:10.5000pt; mso-font-kerning:1.0000pt; \\\\\">2013<font face=\\\\\"宋体\\\\\">年最受消费者欢迎的网购瓷砖品牌之一，</font><font face=\\\\\"Times New Roman\\\\\">2015</font><font face=\\\\\"宋体\\\\\">年周天猫瓷砖品牌热销榜销售额第一位等等的荣誉称号。</font></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\" style=\\\\\"text-align:justify; text-justify:inter-ideograph; \\\\\"><span style=\\\\\"mso-spacerun:\\\\''yes\\\\''; font-family:宋体; font-size:10.5000pt; mso-font-kerning:1.0000pt; \\\\\">&nbsp;</span></p>\r\n<p class=\\\\\"MsoNormal\\\\\" style=\\\\\"text-align:justify; text-justify:inter-ideograph; \\\\\"><span style=\\\\\"mso-spacerun:\\\\''yes\\\\''; font-family:宋体; font-size:10.5000pt; mso-font-kerning:1.0000pt; \\\\\"><span style=\\\\\"mso-spacerun:\\\\''yes\\\\''; font-family:宋体; font-size:10.5000pt; mso-font-kerning:1.0000pt; \\\\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>哈德逊除了在瓷砖本行做得出色之外，近来在建材网上商城也是动作频频。最近上线的</span><span style=\\\\\"font-size: 14px;\\\\\"><span class=\\\\\"15\\\\\" style=\\\\\"font-family: 宋体; text-decoration: underline;\\\\\">易家亲商城</span></span><span style=\\\\\"font-family: 宋体; font-size: 10.5pt;\\\\\">，目标是成为全国最大的在线家装建材超市，专业为您提供家居装修建材团购一站式服务。与各大品牌携手打造绿色品牌家居建材，品质保障，价格优惠，是您家居装修的优选平台。</span></p>\r\n<p class=\\\\\"MsoNormal\\\\\" style=\\\\\"text-align:justify; text-justify:inter-ideograph; \\\\\"><span style=\\\\\"mso-spacerun:\\\\''yes\\\\''; font-family:宋体; font-size:10.5000pt; mso-font-kerning:1.0000pt; \\\\\">&nbsp;</span></p>\r\n<p class=\\\\\"MsoNormal\\\\\" style=\\\\\"margin-left:0.0000pt; text-indent:21.0000pt; mso-pagination:widow-orphan; text-align:left; \\\\\"><span style=\\\\\"mso-spacerun:\\\\''yes\\\\''; font-family:宋体; letter-spacing:0.0000pt; font-weight:normal; text-transform:none; font-style:normal; font-size:10.5000pt; mso-font-kerning:0.0000pt; \\\\\">文章来源：哈德逊瓷砖编辑原创</span></p>\r\n<p class=\\\\\"MsoNormal\\\\\" style=\\\\\"margin-left:0.0000pt; text-indent:21.0000pt; mso-pagination:widow-orphan; text-align:left; \\\\\"><span style=\\\\\"mso-spacerun:\\\\''yes\\\\''; font-family:宋体; letter-spacing:0.0000pt; font-weight:normal; text-transform:none; font-style:normal; font-size:10.5000pt; mso-font-kerning:0.0000pt; \\\\\">转载请注明出处</span><span style=\\\\\"font-family: 宋体; letter-spacing: 0pt; font-weight: normal; text-transform: none; text-decoration: underline; font-style: normal; font-size: 10.5pt;\\\\\">http://www.hudsonhome.cn</span></p>\r\n<p>&nbsp;</p>');");
E_D("replace into `phome_ecms_news_data_1` values('1900','8','','1','0','0','0','','','','<p><span style=\\\\\"mso-spacerun:\\\\''yes\\\\''; font-family:宋体; font-size:10.5000pt; mso-font-kerning:1.0000pt; \\\\\">装修颜色搭配一向是人们关心的话题，瓷砖色彩选择与搭配，关系到整个居室空间的整体效果和装饰品位。在装修颜色搭配上，再细心认真也不为过。今天哈德逊小编就来为大家奉献上《装修颜色搭配表》</span><span style=\\\\\"mso-spacerun:\\\\''yes\\\\''; font-family:宋体; font-size:10.5000pt; mso-font-kerning:1.0000pt; \\\\\">&nbsp;</span><span style=\\\\\"mso-spacerun:\\\\''yes\\\\''; font-family:宋体; font-size:10.5000pt; mso-font-kerning:1.0000pt; \\\\\">：</span>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<table width=\\\\\"600\\\\\" cellspacing=\\\\\"1\\\\\" cellpadding=\\\\\"1\\\\\" border=\\\\\"1\\\\\" align=\\\\\"center\\\\\">\r\n    <caption><strong><span style=\\\\\"font-size: larger;\\\\\">装修颜色搭配表</span></strong></caption>\r\n    <tbody>\r\n        <tr>\r\n            <td>\r\n            <p style=\\\\\"text-align: left;\\\\\"><span style=\\\\\"font-size: 14px;\\\\\">米黄</span></p>\r\n            </td>\r\n            <td><span style=\\\\\"font-size: 14px;\\\\\">使居室有一种富丽堂皇的高贵与典雅</span></td>\r\n        </tr>\r\n        <tr>\r\n            <td style=\\\\\"text-align: left;\\\\\"><span style=\\\\\"font-size: 14px;\\\\\">石纹色</span></td>\r\n            <td><span style=\\\\\"font-size: 14px;\\\\\">古朴自然，显得厚重而富有内涵</span></td>\r\n        </tr>\r\n        <tr>\r\n            <td style=\\\\\"text-align: left;\\\\\"><span style=\\\\\"font-size: 14px;\\\\\">土色和赤土</span></td>\r\n            <td><span style=\\\\\"font-size: 14px;\\\\\">铺在客厅和餐厅地面，可让人体会到田园风格的愉悦和舒适</span></td>\r\n        </tr>\r\n        <tr>\r\n            <td style=\\\\\"text-align: left;\\\\\"><span style=\\\\\"font-size: 14px;\\\\\">蓝色和绿色</span></td>\r\n            <td><span style=\\\\\"font-size: 14px;\\\\\">很容易让人联想到天空的深邃辽阔和草原的自然风景</span></td>\r\n        </tr>\r\n        <tr>\r\n            <td style=\\\\\"text-align: left;\\\\\"><span style=\\\\\"font-size: 14px;\\\\\">红色</span></td>\r\n            <td><span style=\\\\\"font-size: 14px;\\\\\">使地面看上去很特别，有一种华丽的感觉</span></td>\r\n        </tr>\r\n        <tr>\r\n            <td style=\\\\\"text-align: left;\\\\\"><span style=\\\\\"font-size: 14px;\\\\\">灰色</span></td>\r\n            <td><span style=\\\\\"font-size: 14px;\\\\\">更具文化品位和大自然风光，可凝造粗犷不羁的感觉</span></td>\r\n        </tr>\r\n        <tr>\r\n            <td style=\\\\\"text-align: left;\\\\\"><span style=\\\\\"font-size: 14px;\\\\\">黑与白对比</span></td>\r\n            <td><span style=\\\\\"font-size: 14px;\\\\\">可增加地面的层次的结构感</span></td>\r\n        </tr>\r\n        <tr>\r\n            <td colspan=\\\\\"2\\\\\">&nbsp;</td>\r\n        </tr>\r\n        <tr>\r\n            <td style=\\\\\"text-align: center;\\\\\" colspan=\\\\\"2\\\\\"><span style=\\\\\"font-size: 14px;\\\\\">暖色调的墙面的地面可使居室产生一种温馨的氛围</span></td>\r\n        </tr>\r\n        <tr>\r\n            <td style=\\\\\"text-align: center;\\\\\" colspan=\\\\\"2\\\\\"><span style=\\\\\"font-size: 14px;\\\\\">而冷色调的墙地面，则让人感受到一股来自海洋的清凉与凉爽</span></td>\r\n        </tr>\r\n        <tr>\r\n            <td style=\\\\\"text-align: center;\\\\\" colspan=\\\\\"2\\\\\"><span style=\\\\\"font-size: 14px;\\\\\">素色，白色，灰色等浅色显得简约，适合采光较差的房间铺贴</span></td>\r\n        </tr>\r\n        <tr>\r\n            <td style=\\\\\"text-align: center;\\\\\" colspan=\\\\\"2\\\\\"><span style=\\\\\"font-size: 14px;\\\\\">黑色，红色，黄色等深色则显得厚重，适合采光较好的房间铺贴</span></td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<p><!--[if gte mso 9]><xml><w:WordDocument><w:BrowserLevel>MicrosoftInternetExplorer4</w:BrowserLevel><w:DisplayHorizontalDrawingGridEvery>0</w:DisplayHorizontalDrawingGridEvery><w:DisplayVerticalDrawingGridEvery>2</w:DisplayVerticalDrawingGridEvery><w:DocumentKind>DocumentNotSpecified</w:DocumentKind><w:DrawingGridVerticalSpacing>7.8 磅</w:DrawingGridVerticalSpacing><w:PunctuationKerning></w:PunctuationKerning><w:View>Normal</w:View><w:Compatibility><w:DontGrowAutofit /><w:BalanceSingleByteDoubleByteWidth /><w:DoNotExpandShiftReturn /><w:UseFELayout /></w:Compatibil